#!/usr/bin/python3
from functions import *
import unittest
import os
import pandas as pd


class TestFunctions(unittest.TestCase):

    def test_download_bus_data(self):
        download_bus_data(1, 'test_download_bus_data.csv', '9a4a37e2-9e5c-46f8-833d-5e1abbe2d85c')
        self.assert_('test_download_bus_data.csv' in os.listdir())
        os.remove('test_download_bus_data.csv')

    def test_time_diff(self):
        test_series1 = pd.Series(['2021-02-08 17:40:34', '2021-02-08 18:40:34'])
        test_series2 = pd.Series(['00:00:00', '18:40:30'])
        test_series3 = pd.Series(['2021-03-08 00:00:00', '2021-02-08 18:40:30'])
        self.assert_(time_diff(test_series1) == ([1.0], [0]))
        self.assert_(time_diff(test_series2, only_hour=True) == 18.675)
        self.assert_(time_diff(test_series3) == ([653.325], [0]))

    def test_calculate_distance(self):
        test_series1_lat, test_series1_lon = pd.Series([22, 33]), pd.Series([22, 33])
        test_series2_lat, test_series2_lon = pd.Series([22.4234, 2.4234]), pd.Series([22.0002, 33])
        self.assert_(calculate_distance(test_series1_lat, test_series1_lon) == [1630.9171220311898])
        self.assert_(calculate_distance(test_series2_lat, test_series2_lon) == [2511.9153362918405])

